  target.style.position = "absolute";
  if(ol.dom.BrowserFeature.USE_MS_MATRIX_TRANSFORM) {
    target.style.width = "100%";
    target.style.height = "100%"
  }
  goog.base(this, mapRenderer, tileLayer, target);
